text:
LE PRESIDENT DE LA REPUBLIQUE,
VU la Constitution;
VU la loi 2001/002 du 16 avril 2001 autorisant le Président de la République à ratifier le Protocole portant amendement de la Convention relative à l'aviation civile internationale (article 83 bis) signé à Montréal le 6 octobre 1980 ;
DECRETE:
Art. 1er —  Est ratifié, le Protocole portant amendement de la Convention relative à l'aviation civile internationale (article 83 bis), signé à Montréal le 6 octobre 1980.
Art. 2 —  Le présent décret sera enregistré, publié suivant la procédure d'urgence, puis inséré au Journal Officiel en français et en anglais.
